CREATE DATABASE appsDB;

CREATE TABLE appsDB.UserTable (
    ID          VARCHAR(100) NOT NULL PRIMARY KEY,
    PASSWORD    VARCHAR(100) NOT NULL,
    NAME        VARCHAR(100) NOT NULL
);

